description:
Takedown (2010)

During a routine inspection, David (Lou Diamond Phillips), a security guard with a checkered past, discovers a young Serbian girl stowed in a truck. Outnumbered and outgunned, David embarks on a do-or-die mission against the Russian mob and a ruthless human trafficking syndicate to save her.     


